import React, { useEffect, useState } from "react";
import API, { setAuth } from "../services/api";
import { Link } from "react-router-dom";

export default function ReportsList() {
  const [reports, setReports] = useState([]);
  const [faculty, setFaculty] = useState("");

  useEffect(() => {
    const t = localStorage.getItem("token");
    if (t) setAuth(t);
    fetchReports();
  }, []);

  async function fetchReports() {
    try {
      const url = faculty
        ? `/reports?facultyName=${encodeURIComponent(faculty)}`
        : "/reports";
      const res = await API.get(url);
      setReports(res.data);
    } catch (err) {
      console.error("Fetch reports error:", err);
      alert(err.response?.data?.error || err.message);
    }
  }

  async function downloadExcel() {
    try {
      const url = faculty
        ? `/reports/export/xlsx?facultyName=${encodeURIComponent(faculty)}`
        : "/reports/export/xlsx";

      const res = await API.get(url, { responseType: "blob" });

      // Download file
      const blob = new Blob([res.data], {
        type:
          "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet",
      });
      const urlBlob = window.URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = urlBlob;
      a.download = "reports.xlsx";
      document.body.appendChild(a);
      a.click();
      a.remove();
      window.URL.revokeObjectURL(urlBlob);
    } catch (err) {
      console.error("Download Excel error:", err);
      alert(err.message);
    }
  }

  return (
    <div>
      <h3>Reports</h3>
      <div className="mb-2 d-flex">
        <input
          className="form-control me-2"
          value={faculty}
          onChange={(e) => setFaculty(e.target.value)}
          placeholder="Search by faculty..."
        />
        <button className="btn btn-outline-primary me-2" onClick={fetchReports}>
          Search
        </button>
        <button className="btn btn-success" onClick={downloadExcel}>
          Download Excel
        </button>
      </div>

      <div className="row">
        {reports.map((r) => (
          <div className="col-md-6" key={r.id}>
            <div className="card mb-2">
              <div className="card-body">
                <h5 className="card-title">
                  {r.courseName} ({r.courseCode})
                </h5>
                <h6 className="card-subtitle mb-2 text-muted">
                  {r.facultyName} - {r.className}
                </h6>
                <p>
                  <strong>Lecturer:</strong> {r.lecturerName} |{" "}
                  <strong>Date:</strong> {r.dateOfLecture}
                </p>
                <p>
                  <strong>Present:</strong> {r.actualStudentsPresent} /{" "}
                  {r.totalRegisteredStudents}
                </p>
                <p>
                  <strong>Topic:</strong> {r.topicTaught}
                </p>
                <p>
                  <strong>Feedback:</strong> {r.feedback || "â€”"}
                </p>
                <p>
                  <strong>Status:</strong> {r.status}
                </p>

                {/* Role-based actions */}
                {localStorage.getItem("role") === "PRL" && (
                  <Link
                    to={`/reports/${r.id}/review`}
                    className="btn btn-sm btn-primary me-2"
                  >
                    Review
                  </Link>
                )}
                {localStorage.getItem("role") === "PL" &&
                  r.status === "REVIEWED" && (
                    <Link
                      to={`/reports/${r.id}/finalize`}
                      className="btn btn-sm btn-success"
                    >
                      Finalize
                    </Link>
                  )}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
